function List(props) { 
    const listLinks = props.links.map((link, index)  => <li key={index}><Link >{link}</Link></li>); // Coloque o funcao dentro de um variavel
    return (<ul className={props.styleNew} >
      {listLinks}
   </ul>)
}

export default List;
